import React from 'react'
import {ChannelDetails} from '../index'
import VidioCard from './VidioCard'

const Vidios = (props) => {
    const vidios = props.Vidios
    console.log(vidios)
    return (
        <div>
            {vidios.map((item , inx) => {
                item.id.vidioId &&  <VidioCard vidio={item} key={inx} />
                item.id.channelId &&   <ChannelDetails vidio={item} key={inx} />
            })}
        </div>
    )
}

export default Vidios
